import React, { useState, useEffect, useContext } from "react";
import UserContext from "./UserContext";
import ScareBnBApi from "./api";
import ListingCard from "./ListingCard";

/**Shows homepage
 *
 * useContext= user
 * props=none
 * state=none
 *
 * Routes --> Homepage
 */

function Homepage() {
  console.log("homepage");
  const {currUser, token} = useContext(UserContext)
  const [guestToken, setGuestToken] = useState(ScareBnBApi.token)
  const [listings, setListings] = useState({
    data: null,
    isLoading: true,
  });

  useEffect(function getGuestTokenOnMount() {
    console.log('getGuestTokenOnMount');
    async function getGuestToken() {
      const response = await ScareBnBApi.is_guest();
      setGuestToken(response.token)
      ScareBnBApi.token = response.token;
      console.log('token', ScareBnBApi.token)
    }
  })

  useEffect(function getListingsOnMount() {
    console.log("getListingsOnMount");
    async function fetchListings() {
      const response = await ScareBnBApi.getListingsForGuest();
      setListings({ data: response, isLoading: false });
    }
    fetchListings();
  }, []);

  if(listings.isLoading === true) {
    return <p>Loading...</p>
  }


  return (
    <div className="Homepage">
      {listings.data.map((listing) => (
        <ListingCard key={listing.id} listing={listing} />
      ))}
    </div>
  );
}

export default Homepage;
